// src/pages/NovoAdmin.jsx
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

const NovoAdmin = () => {
    const navigate = useNavigate();
    const [form, setForm] = useState({
        nome: '',
        email: '',
        senha: '',
        nivelAcesso: 'admin',
        ativo: true
    });
    const [errors, setErrors] = useState({});

    const handleChange = e => {
        const { name, value, type, checked } = e.target;
        setForm(f => ({ ...f, [name]: type === 'checkbox' ? checked : value }));
        setErrors(err => ({ ...err, [name]: null }));
    };

    const handleSubmit = async e => {
        e.preventDefault();
        try {
            await api.post('/admins', form);
            navigate('/');
        } catch (err) {
            const resp = err.response?.data;
            if (resp?.erros) {
                const fieldErrors = resp.erros.reduce(
                    (acc, cur) => ({ ...acc, [cur.path]: cur.msg }),
                    {}
                );
                setErrors(fieldErrors);
            } else {
                setErrors({ form: resp?.erro || 'Erro ao cadastrar admin' });
            }
        }
    };

    return (
        <div className="container my-5">
            <div className="d-flex justify-content-between align-items-center mb-4">
                <h2>Cadastrar Novo Admin</h2>
                <div>
                    <Link to="/" className="btn btn-outline-secondary me-2">Voltar ao Início</Link>
                    <Link to="/admins" className="btn btn-secondary">Ver Admins</Link>
                </div>
            </div>

            {errors.form && (
                <div className="alert alert-danger">{errors.form}</div>
            )}

            <form onSubmit={handleSubmit}>
                <div className="mb-3">
                    <label className="form-label">Nome</label>
                    <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
                    {errors.nome && <div className="text-danger">{errors.nome}</div>}
                </div>

                <div className="mb-3">
                    <label className="form-label">Email</label>
                    <input name="email" type="email" className="form-control" value={form.email} onChange={handleChange} />
                    {errors.email && <div className="text-danger">{errors.email}</div>}
                </div>

                <div className="mb-3">
                    <label className="form-label">Senha</label>
                    <input name="senha" type="password" className="form-control" value={form.senha} onChange={handleChange} />
                    {errors.senha && <div className="text-danger">{errors.senha}</div>}
                </div>

                <div className="mb-3">
                    <label className="form-label">Nível de Acesso</label>
                    <select name="nivelAcesso" className="form-select" value={form.nivelAcesso} onChange={handleChange}>
                        <option value="admin">Admin</option>
                        <option value="super">Super</option>
                        <option value="moderador">Moderador</option>
                    </select>
                    {errors.nivelAcesso && <div className="text-danger">{errors.nivelAcesso}</div>}
                </div>

                <div className="form-check mb-3">
                    <input className="form-check-input" type="checkbox" name="ativo" checked={form.ativo} onChange={handleChange} />
                    <label className="form-check-label">Ativo</label>
                </div>

                <button type="submit" className="btn btn-primary">Cadastrar Admin</button>
            </form>
        </div>
    );
};

export default NovoAdmin;
